import './app/css/stylesheet.css';
import Home from './app/Home';

ReactDOM.render(
  <div>
    <Router>
      <Routes>
        <Route path="/" element={<Browse />} />
        <Route path="/follows" element={<Follows />} />
      </Routes>
    </Router>
    <Home />
  </div>,
  document.getElementById('root')
);
